/// Sections : {"section":[{"Title":"The Basics: Overview","Description":"","Content":"<p>Children ages 5 to 10 years need to go to the doctor or nurse for a “well-child visit” once a year.</p>\r\n\r\n<p>A well-child visit is when you take your child to the doctor to make sure they’re healthy and developing normally. This is different from other visits for sickness or injury.</p>\r\n\r\n<p>At a well-child visit, the doctor or nurse can help catch any problems early, when they may be easier to treat. You’ll also have a chance to ask any questions you may have about your child’s behavior or development.</p>\r\n\r\n<p>Learn what to expect so you can make the most of each visit.</p>\r\n"},{"Title":"The Basics: Child Development","Description":"","Content":"<h4>How do I know if my child is growing and developing on&nbsp;schedule?</h4>\r\n\r\n<p>Your child’s doctor or nurse can help you understand how your child is developing and learning to do new things — like read or brush their teeth. These are sometimes called “developmental milestones.”</p>\r\n\r\n<p>Developmental milestones for children ages 5 to 10 years include physical, learning, and social skills — things like:</p>\r\n\r\n<ul>\r\n\t<li>Developing skills for success in school (like listening, paying attention, reading, and math)</li>\r\n\t<li>Taking care of their&nbsp;bodies without help&nbsp;(like bathing, brushing teeth, and getting&nbsp;dressed)</li>\r\n\t<li>Learning from mistakes or failures and trying again</li>\r\n\t<li>Helping with simple chores</li>\r\n\t<li>Following family rules</li>\r\n\t<li>Developing friendships and getting along with other children</li>\r\n\t<li>Participating in activities like&nbsp;school clubs, sports teams, or music lessons</li>\r\n</ul>\r\n\r\n<p>See a complete list of developmental milestones for kids who are:</p>\r\n\r\n<ul>\r\n\t<li><a href=\"https://health.gov/myhealthfinder/api/outlink/topicsearch.json/https/www.cdc.gov/ncbddd/actearly/milestones/milestones-5yr.html?_label_=Age+5%26nbsp%3Byears\">Age 5&nbsp;years</a></li>\r\n\t<li><a href=\"https://health.gov/myhealthfinder/api/outlink/topicsearch.json/http/www.cdc.gov/ncbddd/childdevelopment/positiveparenting/middle.html?_label_=Ages+6+to+8%26nbsp%3Byears\">Ages 6 to 8&nbsp;years</a></li>\r\n\t<li><a href=\"https://health.gov/myhealthfinder/api/outlink/topicsearch.json/http/www.cdc.gov/ncbddd/childdevelopment/positiveparenting/middle2.html?_label_=Ages+9+to+11%26nbsp%3Byears\">Ages 9 to 11&nbsp;years</a></li>\r\n</ul>\r\n"},{"Title":"Take Action: Get Ready","Description":"","Content":"<p>Take these steps to help you and your child get the most out of well-child visits.</p>\r\n\r\n<h4>Gather important information.</h4>\r\n\r\n<p>Take any medical records you have to the appointment, including a record of vaccines (shots) your child has received. If your child gets special services at school because of a health condition or disability, bring that paperwork, too.</p>\r\n\r\n<p>Make a list of any important changes in your child’s life since the last doctor’s visit, like a:</p>\r\n\r\n<ul>\r\n\t<li>New brother or sister</li>\r\n\t<li>Separation or divorce&nbsp;— or a parent spending time in jail or prison</li>\r\n\t<li>New school or a move to a new neighborhood</li>\r\n\t<li>Serious illness or death of a friend or family member</li>\r\n</ul>\r\n\r\n<p>Use this tool to&nbsp;<a href=\"https://health.gov/myhealthfinder/api/outlink/topicsearch.json/https/cbiit.github.io/FHH/html/index.html?_label_=keep+track+of+your+child%E2%80%99s+family+health+history\">keep track of your child’s family health history</a>.</p>\r\n\r\n<h4>Help your child get more involved in doctor visits.</h4>\r\n\r\n<p>You can help your child get involved by letting them know&nbsp;what to expect. <a href=\"https://health.gov/myhealthfinder/api/outlink/topicsearch.json/https/kidshealth.org/en/parents/dr-visits.html?_label_=Learn+how+to+prepare+your+child+for+a+doctor+visit\">Learn how to prepare your child for a doctor visit</a>.</p>\r\n\r\n<h5>What about cost?</h5>\r\n\r\n<p>Under the Affordable Care Act, insurance plans must cover well-child visits. Depending on your insurance plan, you may be able to get well-child visits at no cost to you. Check with your insurance company to find out more.</p>\r\n\r\n<p>Your child may also qualify for free or low-cost health insurance through Medicaid or the Children’s Health Insurance Program (CHIP). <a href=\"https://health.gov/myhealthfinder/api/outlink/topicsearch.json/https/www.insurekidsnow.gov/coverage/index.html?_label_=Learn+about+coverage+options\">Learn about coverage options</a> for your family.</p>\r\n\r\n<p>If you don’t have insurance, you may still be able to get free or low-cost well-child visits. <a href=\"https://health.gov/myhealthfinder/api/outlink/topicsearch.json/https/findahealthcenter.hrsa.gov/?_label_=Find+a+health+center+near+you\">Find a health center near you</a> and ask about well-child visits.</p>\r\n\r\n<p>To learn more, check out these resources:</p>\r\n\r\n<ul>\r\n\t<li><a href=\"https://health.gov/myhealthfinder/api/outlink/topicsearch.json/https/www.healthcare.gov/preventive-care-children/?_label_=Free+preventive+care+for+children+covered+by+the+Affordable+Care+Act\">Free preventive care for children covered by the Affordable Care Act</a></li>\r\n\t<li><a href=\"https://health.gov/myhealthfinder/api/outlink/topicsearch.json/https/www.healthcare.gov/health-care-law-protections/?_label_=How+the+Affordable+Care+Act+protects+you+and+your+family\">How the Affordable Care Act protects you and your family</a></li>\r\n\t<li><a href=\"https://health.gov/myhealthfinder/api/outlink/topicsearch.json/https/marketplace.cms.gov/technical-assistance-resources/c2c-roadmap.pdf?_label_=Understanding+your+health+insurance+and+how+to+use+it+%5BPDF+-+698+KB%5D\">Understanding your health insurance and how to use it [PDF - 698 KB]</a></li>\r\n</ul>\r\n"},{"Title":"Take Action: Ask Questions","Description":"","Content":"<h4>Make a list of questions you want to ask the doctor.</h4>\r\n\r\n<p>Before the well-child visit, write down 3 to 5 questions you have. This visit is a great time to ask the doctor or nurse any questions about:</p>\r\n\r\n<ul>\r\n\t<li>A health condition your child has (like asthma, allergies, or a speech problem)</li>\r\n\t<li>Changes in behavior or mood</li>\r\n\t<li>Problems in school —&nbsp;with learning or with other children</li>\r\n</ul>\r\n\r\n<p>Here are some important questions to ask:</p>\r\n\r\n<ul>\r\n\t<li>Is my child up&nbsp;to&nbsp;date on vaccines?</li>\r\n\t<li>How can I make sure my child is getting enough physical activity?</li>\r\n\t<li>How can I help my child eat healthy?</li>\r\n\t<li>Is my child at a healthy weight?</li>\r\n\t<li>How can I teach my child to use the internet safely?</li>\r\n\t<li>How can I talk with my child about bullying?</li>\r\n\t<li>How can I help my child know what to expect during puberty?</li>\r\n</ul>\r\n\r\n<p>Take a notepad, smartphone, or tablet and write down the answers so you can remember them&nbsp;later.</p>\r\n\r\n<h5>Ask what to do if your child gets sick.</h5>\r\n\r\n<p>Make sure you know how to get in touch with a doctor or nurse when the office is closed. Ask how to get hold of the doctor on call, or if there's a nurse&nbsp;information service you can call at night or on the weekend.&nbsp;</p>\r\n"},{"Title":"Take Action: What to Expect","Description":"","Content":"<h4>Know what to expect.</h4>\r\n\r\n<p>During each well-child visit, the doctor or nurse will ask you questions about your child, do a physical exam, and&nbsp;update your child’s medical history. You'll also be able to ask your questions and discuss any problems.&nbsp;</p>\r\n\r\n<h4>The doctor or nurse will ask you and your child questions.</h4>\r\n\r\n<p>The doctor or nurse may ask about:</p>\r\n\r\n<ul>\r\n\t<li>Behavior — Does your child have trouble following directions at home or at&nbsp;school?</li>\r\n\t<li>Health — Does your child often complain of headaches or other&nbsp;pain?</li>\r\n\t<li>Emotions — Is your child often very worried about bad things happening?</li>\r\n\t<li>School — Does your child look forward to going to school?</li>\r\n\t<li>Activities&nbsp;— What does your child like to do after school and on weekends?</li>\r\n\t<li>Eating habits — What does your child eat on a normal day?</li>\r\n\t<li>Family — Have there been any changes in your family since your last&nbsp;visit?</li>\r\n</ul>\r\n\r\n<p>They may also ask questions about safety, like:</p>\r\n\r\n<ul>\r\n\t<li>Does your child always ride in the back seat of the car?</li>\r\n\t<li>Does anyone in your home have a gun? If so, is it unloaded and locked in a place where your child can’t get it?</li>\r\n\t<li>Is there a swimming pool or other water around your home?</li>\r\n</ul>\r\n\r\n<p>Your answers to questions like these will help the doctor or nurse make sure your child is healthy, safe, and developing normally.</p>\r\n"},{"Title":"Take Action: Physical Exam","Description":"","Content":"<h4>The doctor or nurse will also check your child’s body.</h4>\r\n\r\n<p>To check your child’s body, the doctor or nurse will:</p>\r\n\r\n<ul>\r\n\t<li>Measure your child’s height and weight</li>\r\n\t<li>Check your child’s blood pressure</li>\r\n\t<li>Check your child’s vision&nbsp;and hearing</li>\r\n\t<li>Check your child’s body parts&nbsp;(this is called a physical exam)</li>\r\n\t<li>Give your child shots they need</li>\r\n</ul>\r\n\r\n<p>Learn more about your child’s health care.</p>\r\n\r\n<ul>\r\n\t<li><a href=\"https://health.gov/myhealthfinder/api/outlink/topicsearch.json/https/health.gov/myhealthfinder/topics/doctor-visits/shots-vaccines/get-your-childs-shots-schedule?_label_=Find+out+how+to+get+your+child%E2%80%99s+vaccines%26nbsp%3Bon+schedule\">Find out how to get your child’s vaccines&nbsp;on schedule</a></li>\r\n\t<li><a href=\"https://health.gov/myhealthfinder/api/outlink/topicsearch.json/https/health.gov/myhealthfinder/topics/doctor-visits/screening-tests/get-your-childs-vision-checked?_label_=Learn+about+getting+your+child%E2%80%99s+vision+checked\">Learn about getting your child’s vision checked</a></li>\r\n</ul>\r\n"}]}
